int solve3(int R, int C) {
   if ((R*C % 3) != 0) return 0;
   if (R == 1) return 0;
   return 1;
}

int solve4(int R, int C) {
   if ((R*C % 4) != 0) return 0;
   if (R <= 2) return 0;
   return 1;
}

void try2(int index) {
	if(index==N) {
		compare();
		return;
	}
	if(Q[index]=='?') {
		int i;
		for(i=0; i<10; i++) {
			Q[index] = i + '0';
			try2(index+1);
		}
		Q[index] = '?';
	} else try2(index+1);
}

void try(int index) {
	if(index==N) {
		try2(0);
		return;
	}
	if(P[index]=='?') {
		int i;
		for(i=0; i<10; i++) {
			P[index] = i + '0';
			try(index+1);
		}
		P[index] = '?';
	} else try(index+1);
}

